searched_data=[]
threshold=0
records=[]

@app.route('/')
def home():
    return render_template('home.html')

@app.route('/set')
def set():
    return render_template('threshold.html', threshold = threshold) 

@app.route('/main')
def main():
    return render_template('main.html', threshold = threshold, searched_data=searched_data)

@app.route('/record')
def record():
	# 别的地方有record的名字，不管是不是变量，这里都不能用record了
    return render_template('record.html', records=records)

@app.route('/save_threshold',methods=['POST'])
def save_threshold():
    global threshold
  
    new_threshold = request.get_json()   
    threshold=new_threshold

    return jsonify(threshold=threshold)

@app.route('/save_record',methods=['POST'])
def save_record():
    global records
  
    new_record = request.get_json()   
    records.append(new_record)

    return jsonify(records=records)



@app.route('/search_data',methods=['GET', 'POST'])
def search_data():
    global data
    global searched_data
    searched_data=[]
    words = request.get_json()   
    for i in range(0,len(data)):
    	if words in data[i]["name"].lower():
    		searched_data.append(data[i])

    return jsonify(searched_data=searched_data)

@app.route('/Add_item')
def add_item():
    return render_template('add_item.html', data = data) 

@app.route('/save_data',methods=['POST'])
def save_data():
    global data
    new_id = len(data) + 1;
    json_data = request.get_json()   
    json_data["Id"] = new_id
    data.append(json_data)

    return jsonify(data=data)


@app.route('/Item/<item_id>')
def item(item_id=None):
	display = data[int(item_id)-1];
	return render_template('item.html', display=display)


@app.route('/search')
def search():
    return render_template('search.html', searched_data=searched_data)





@app.route('/search_results/<id_list>')
def search_results(id_list=None):
	display = data[int(item_id)];
	return render_template('item.html', display=display)

